public final class HealCommand implements CommandExecutor {
    @Override
    public boolean onCommand(CommandSender sender, Command command, String label, String[] args) {
        if (args.length != 1) return false;
        Player target = Bukkit.getPlayerExact(args[0]);
        if (target == null) {
            sender.sendMessage(Component.text("Player not found."));
            return true;
        }
        double next = Math.min(target.getAttribute(Attribute.GENERIC_MAX_HEALTH).getValue(), target.getHealth() + 8.0D);
        target.setHealth(next);
        sender.sendMessage(Component.text("Healed " + target.getName()));
        return true;
    }
}

@Override
public void onEnable() {
    PluginCommand cmd = getCommand("healplayer");
    if (cmd != null) {
        cmd.setExecutor(new HealCommand());
    }
}

class BlockGuard : Listener {
    @EventHandler
    fun onBreak(event: BlockBreakEvent) {
        if (!event.player.isOp) {
            event.isCancelled = true
            event.player.sendMessage(Component.text("You cannot break blocks here."))
        }
    }
}

